export enum CycleType {
  MARQUE_BRIEF = "Cycle 1: Marque & Brief",
  NARRATION_IA = "Cycle 2: Narration & IA",
  LOOKDEV = "Cycle 3: Look-dev & Sélection",
  PACKAGING = "Cycle 4: Packaging & Soutenance"
}

export interface Deliverable {
  id: string;
  name: string;
  description: string;
  status: 'pending' | 'submitted' | 'validated' | 'rejected';
  score?: number; // 0-100
  feedback?: string;
  fileUrl?: string;
}

export interface WeekModule {
  id: string; // e.g., "S13"
  title: string;
  type: 'FUN/CHILL' | 'THÉORIE' | 'TECHNIQUE' | 'JURY';
  objectives: string[];
  deliverables: Deliverable[];
  locked: boolean;
}

export interface Student {
  id: string;
  name: string;
  role: 'Creative Director' | '3D Artist' | 'Motion Designer' | 'Producer';
  avatarUrl: string;
}

export interface Agency {
  id: string;
  name: string;
  tagline: string;
  logoUrl?: string;
  members: Student[];
  fundsRaised: number; // La "note" gamifiée en €
  valuation: number; // Potentiel total
  currentCycle: CycleType;
  constraints: {
    space: string;
    style: string;
    client: string;
  };
  progress: {
    [weekId: string]: WeekModule;
  };
}

export interface AppState {
  userRole: 'admin' | 'student';
  selectedAgencyId: string | null;
  agencies: Agency[];
}

