import React, { useState } from 'react';
import { Agency, WeekModule } from '../types';
import { CheckCircle2, Circle, Upload, MessageSquare, Loader2, Wand2 } from 'lucide-react';
import { generateAgencyNames, generateFeedback } from '../services/geminiService';

interface StudentViewProps {
  agency: Agency;
  onUpdateAgency: (agency: Agency) => void;
}

export const StudentAgencyView: React.FC<StudentViewProps> = ({ agency, onUpdateAgency }) => {
  const [activeWeek, setActiveWeek] = useState<string>("S13");
  const [isGenerating, setIsGenerating] = useState(false);
  const [isUploading, setIsUploading] = useState<string | null>(null);

  const currentWeekData = agency.progress[activeWeek];

  const handleGenerateName = async () => {
    setIsGenerating(true);
    const suggestions = await generateAgencyNames(agency.constraints);
    if (suggestions.length > 0) {
      // For demo purposes, we automatically pick the first one, but UI could allow selection
      onUpdateAgency({
        ...agency,
        name: suggestions[0].name,
        tagline: suggestions[0].tagline
      });
    }
    setIsGenerating(false);
  };

  const handleFileUpload = async (deliverableId: string) => {
    setIsUploading(deliverableId);
    // Simulate upload delay
    setTimeout(async () => {
        // AI Feedback Simulation
        const deliverable = currentWeekData.deliverables.find(d => d.id === deliverableId);
        const feedback = await generateFeedback(deliverable?.name || "Livrable", agency.constraints.style);

        const updatedWeek = { ...currentWeekData };
        const updatedDeliverables = updatedWeek.deliverables.map(d => 
            d.id === deliverableId ? { ...d, status: 'submitted' as const, fileUrl: '#', feedback: feedback } : d
        );
        updatedWeek.deliverables = updatedDeliverables;

        onUpdateAgency({
            ...agency,
            progress: {
                ...agency.progress,
                [activeWeek]: updatedWeek
            }
        });
        setIsUploading(null);
    }, 1500);
  };

  return (
    <div className="space-y-8 animate-in fade-in duration-500">
      {/* Header Agency Identity */}
      <div className="bg-slate-800/50 border border-indigo-500/30 rounded-2xl p-8 relative overflow-hidden">
        <div className="absolute top-0 right-0 p-4 opacity-10">
            <Wand2 size={120} />
        </div>
        <div className="relative z-10 flex justify-between items-start">
            <div>
                <h2 className="text-4xl font-bold text-white mb-2 font-tracking-tight">{agency.name}</h2>
                <p className="text-indigo-300 text-lg italic mb-4">"{agency.tagline}"</p>
                <div className="flex gap-4 mt-6">
                    <ConstraintBadge label="Espace" value={agency.constraints.space} />
                    <ConstraintBadge label="Style" value={agency.constraints.style} />
                    <ConstraintBadge label="Client" value={agency.constraints.client} />
                </div>
            </div>
            <div className="text-right">
                <div className="text-sm text-slate-400 uppercase tracking-wider mb-1">Valorisation (Levée de fonds)</div>
                <div className="text-4xl font-bold text-emerald-400">{agency.fundsRaised.toLocaleString()} €</div>
                <div className="text-xs text-slate-500 mt-2">Objectif: 500k €</div>
                <div className="w-full bg-slate-700 h-2 rounded-full mt-2 overflow-hidden">
                    <div 
                        className="bg-emerald-500 h-full transition-all duration-1000" 
                        style={{ width: `${(agency.fundsRaised / agency.valuation) * 100}%`}}
                    />
                </div>
            </div>
        </div>
        {agency.name === "Nouvelle Agence" && (
            <button 
                onClick={handleGenerateName}
                disabled={isGenerating}
                className="mt-6 flex items-center gap-2 bg-indigo-600 hover:bg-indigo-500 text-white px-4 py-2 rounded-lg transition-colors"
            >
                {isGenerating ? <Loader2 className="animate-spin" size={18} /> : <Wand2 size={18} />}
                Générer une identité avec Gemini
            </button>
        )}
      </div>

      {/* Timeline Navigation */}
      <div className="flex gap-2 overflow-x-auto pb-4 border-b border-slate-800">
        {Object.values(agency.progress).map((week) => (
            <button
                key={week.id}
                onClick={() => setActiveWeek(week.id)}
                className={`flex flex-col items-center min-w-[100px] p-3 rounded-xl border transition-all ${
                    activeWeek === week.id 
                    ? 'bg-indigo-900/40 border-indigo-500 text-white' 
                    : week.locked 
                        ? 'bg-slate-900 border-slate-800 text-slate-600 cursor-not-allowed'
                        : 'bg-slate-800 border-slate-700 text-slate-400 hover:border-slate-500'
                }`}
            >
                <span className="text-xs font-bold uppercase">{week.id}</span>
                <span className="text-[10px] truncate w-full text-center mt-1">{week.type}</span>
            </button>
        ))}
      </div>

      {/* Week Content */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        {/* Objectives */}
        <div className="lg:col-span-1 space-y-6">
            <div className="bg-slate-800 rounded-xl p-6 border border-slate-700">
                <h3 className="text-lg font-semibold text-slate-200 mb-4 flex items-center gap-2">
                    <span className="w-2 h-8 bg-indigo-500 rounded-full"></span>
                    Objectifs {activeWeek}
                </h3>
                <ul className="space-y-3">
                    {currentWeekData.objectives.map((obj, i) => (
                        <li key={i} className="flex items-start gap-3 text-slate-400 text-sm">
                            <CheckCircle2 size={16} className="text-indigo-400 mt-1 shrink-0" />
                            {obj}
                        </li>
                    ))}
                </ul>
            </div>

            <div className="bg-slate-800 rounded-xl p-6 border border-slate-700">
                 <h3 className="text-lg font-semibold text-slate-200 mb-4">L'équipe</h3>
                 <div className="flex -space-x-3 overflow-hidden mb-4">
                    {agency.members.map(member => (
                        <img key={member.id} className="inline-block h-10 w-10 rounded-full ring-2 ring-slate-800" src={member.avatarUrl} alt={member.name} />
                    ))}
                 </div>
                 <p className="text-xs text-slate-500">Tous les membres doivent valider les livrables pour passer la Gate.</p>
            </div>
        </div>

        {/* Deliverables Zone */}
        <div className="lg:col-span-2 space-y-4">
            <h3 className="text-xl font-bold text-white mb-6">Livrables & Dépôts</h3>
            {currentWeekData.deliverables.map((deliverable) => (
                <div key={deliverable.id} className="bg-slate-800/50 border border-slate-700 rounded-xl p-6 transition-all hover:border-indigo-500/50">
                    <div className="flex justify-between items-start mb-4">
                        <div>
                            <h4 className="font-semibold text-lg text-slate-200">{deliverable.name}</h4>
                            <p className="text-sm text-slate-400">{deliverable.description}</p>
                        </div>
                        <StatusBadge status={deliverable.status} />
                    </div>

                    {deliverable.status === 'pending' && (
                         <div className="mt-4 border-2 border-dashed border-slate-600 rounded-lg p-6 flex flex-col items-center justify-center text-center hover:bg-slate-800 transition-colors group cursor-pointer relative">
                             <input 
                                type="file" 
                                className="absolute inset-0 opacity-0 cursor-pointer" 
                                onChange={() => handleFileUpload(deliverable.id)}
                            />
                             {isUploading === deliverable.id ? (
                                <Loader2 className="animate-spin text-indigo-400 mb-2" />
                             ) : (
                                <Upload className="text-slate-500 group-hover:text-indigo-400 mb-2 transition-colors" />
                             )}
                             <span className="text-sm text-slate-400">Glisser-déposer ou cliquer pour upload</span>
                         </div>
                    )}

                    {deliverable.status === 'submitted' && deliverable.feedback && (
                        <div className="mt-4 bg-indigo-900/20 border border-indigo-500/30 rounded-lg p-4">
                            <div className="flex gap-3">
                                <MessageSquare className="text-indigo-400 shrink-0" size={20} />
                                <div>
                                    <h5 className="text-xs font-bold text-indigo-300 uppercase mb-1">Feedback Automatisé (IA)</h5>
                                    <p className="text-sm text-slate-300 leading-relaxed">"{deliverable.feedback}"</p>
                                </div>
                            </div>
                        </div>
                    )}
                </div>
            ))}
        </div>
      </div>
    </div>
  );
};

const ConstraintBadge: React.FC<{ label: string; value: string }> = ({ label, value }) => (
    <div className="bg-slate-900/50 px-3 py-1.5 rounded border border-slate-700 text-xs">
        <span className="text-slate-500 mr-2 uppercase font-bold">{label}</span>
        <span className="text-slate-200 font-medium">{value}</span>
    </div>
);

const StatusBadge: React.FC<{ status: string }> = ({ status }) => {
    const styles: {[key: string]: string} = {
        pending: 'bg-slate-700 text-slate-400',
        submitted: 'bg-blue-900/50 text-blue-300 border-blue-700',
        validated: 'bg-emerald-900/50 text-emerald-300 border-emerald-700',
        rejected: 'bg-red-900/50 text-red-300 border-red-700'
    };

    const labels: {[key: string]: string} = {
        pending: 'À faire',
        submitted: 'En revue',
        validated: 'Validé',
        rejected: 'À revoir'
    };

    return (
        <span className={`px-2 py-1 rounded text-xs font-semibold border border-transparent ${styles[status]}`}>
            {labels[status]}
        </span>
    );
};

import React, { useState } from 'react';
import { Layout } from './components/Layout';
import { AdminDashboard } from './components/AdminDashboard';
import { StudentAgencyView } from './components/StudentAgencyView';
import { MOCK_AGENCIES, CONSTRAINTS_POOL } from './constants';
import { Agency } from './types';

const App: React.FC = () => {
  const [role, setRole] = useState<'admin' | 'student'>('admin');
  const [agencies, setAgencies] = useState<Agency[]>(MOCK_AGENCIES);
  const [selectedAgencyId, setSelectedAgencyId] = useState<string | null>(null);

  // Helper to switch roles for demo
  const switchRole = () => {
    setRole(prev => prev === 'admin' ? 'student' : 'admin');
    setSelectedAgencyId(null); // Reset selection
  };

  // Helper to shuffle constraints (The "Tirage au sort" feature)
  const shuffleConstraints = (agencyId: string) => {
    setAgencies(prev => prev.map(agency => {
      if (agency.id === agencyId) {
        const randomSpace = CONSTRAINTS_POOL.space[Math.floor(Math.random() * CONSTRAINTS_POOL.space.length)];
        const randomStyle = CONSTRAINTS_POOL.style[Math.floor(Math.random() * CONSTRAINTS_POOL.style.length)];
        const randomClient = CONSTRAINTS_POOL.client[Math.floor(Math.random() * CONSTRAINTS_POOL.client.length)];
        return {
          ...agency,
          constraints: { space: randomSpace, style: randomStyle, client: randomClient }
        };
      }
      return agency;
    }));
  };

  const updateAgency = (updatedAgency: Agency) => {
    setAgencies(prev => prev.map(a => a.id === updatedAgency.id ? updatedAgency : a));
  };

  // Logic to determine what to render
  const renderContent = () => {
    if (role === 'admin') {
      if (selectedAgencyId) {
        const agency = agencies.find(a => a.id === selectedAgencyId);
        if (!agency) return <div>Agence introuvable</div>;
        return (
            <div>
                 <button 
                    onClick={() => setSelectedAgencyId(null)}
                    className="mb-4 text-slate-400 hover:text-white flex items-center gap-2 text-sm"
                 >
                    ← Retour au tableau de bord
                 </button>
                 <StudentAgencyView agency={agency} onUpdateAgency={updateAgency} />
            </div>
        );
      }
      return (
        <AdminDashboard 
            agencies={agencies} 
            onSelectAgency={setSelectedAgencyId}
            onShuffleConstraints={shuffleConstraints}
        />
      );
    } else {
      // Student View: defaults to the first agency for demo purposes
      // In a real app, this would be determined by the logged-in user
      const myAgency = agencies[0]; 
      return <StudentAgencyView agency={myAgency} onUpdateAgency={updateAgency} />;
    }
  };

  return (
    <Layout role={role} switchRole={switchRole}>
      {renderContent()}
    </Layout>
  );
};

export default App;

