const StatusBadge: React.FC<{ status: string; large?: boolean }> = ({ status, large }) => {
    const styles: {[key: string]: string} = {
        stable: 'bg-emerald-500/10 text-emerald-400 border-emerald-500/20',
        fragile: 'bg-amber-500/10 text-amber-400 border-amber-500/20',
