import { AreaChart, Area, Tooltip, ResponsiveContainer } from 'recharts';

interface StudentViewProps {
  agency: Agency;
  onUpdateAgency: (agency: Agency) => void;
}

export const StudentAgencyView: React.FC<StudentViewProps> = ({ agency, onUpdateAgency }) => {
  const [activeWeek, setActiveWeek] = useState<string>("S13");
  const [isGenerating, setIsGenerating] = useState(false);
  const [isUploading, setIsUploading] = useState<string | null>(null);

  const currentWeekData = agency.progress[activeWeek];

  // Reconstruct history from events for the chart
  // This is a simplified reconstruction. In a real app, backend would serve this.
  let cumulativeVE = 0;
  const chartData = agency.eventLog
      .filter(e => e.type === 'VE_DELTA' || e.type === 'CRISIS' || e.type === 'CHECKPOINT')
      .map(e => {
          cumulativeVE += (e.deltaVE || 0);
          return { name: e.date, value: Math.max(0, Math.min(100, cumulativeVE)), label: e.label };
      });

  // Ensure we display current VE even if no events match strictly today
  if (chartData.length === 0 || chartData[chartData.length-1].value !== agency.ve_current) {
      chartData.push({ name: 'Actuel', value: agency.ve_current, label: 'Maintenant' });
  }

  const handleGenerateName = async () => {
    setIsGenerating(true);
    const suggestions = await generateAgencyNames(agency.constraints);
    if (suggestions.length > 0) {
      onUpdateAgency({
        ...agency,
        name: suggestions[0].name,
        tagline: suggestions[0].tagline
      });
    }
    setIsGenerating(false);
  };

  const handleFileUpload = async (deliverableId: string) => {
    setIsUploading(deliverableId);
    setTimeout(async () => {
        const deliverable = currentWeekData.deliverables.find(d => d.id === deliverableId);
        const feedback = await generateFeedback(deliverable?.name || "Livrable", agency.constraints.style);

        const updatedWeek = { ...currentWeekData };
        updatedWeek.deliverables = updatedWeek.deliverables.map(d => 
            d.id === deliverableId ? { ...d, status: 'submitted' as const, fileUrl: '#', feedback: feedback } : d
        );

        // Add an event for the submission
        const newEvent: GameEvent = {
            id: `evt-${Date.now()}`,
            date: new Date().toISOString().split('T')[0],
            type: 'VE_DELTA',
            label: `Rendu ${deliverable?.name}`,
            deltaVE: 5,
            description: "Validation automatique MVP"
        };

        onUpdateAgency({
            ...agency,
            ve_current: Math.min(100, agency.ve_current + 5),
            eventLog: [...agency.eventLog, newEvent],
            progress: {
                ...agency.progress,
                [activeWeek]: updatedWeek
            }
        });
        setIsUploading(null);
    }, 1500);
