interface MarketOverviewProps {
  agency: Agency;
  allAgencies: Agency[];
}

export const MarketOverview: React.FC<MarketOverviewProps> = ({ agency, allAgencies }) => {
  // Mock Data generator for the chart
  const generateComparisonData = () => {
    const data = [
      { name: 'S01', [agency.name]: 50, ...allAgencies.reduce((acc, a) => ({...acc, [a.name]: 50}), {}) },
      { name: 'S13', [agency.name]: 55, ...allAgencies.reduce((acc, a) => ({...acc, [a.name]: a.ve_current > 50 ? 55 : 45}), {}) },
      { name: 'S14', [agency.name]: agency.ve_current, ...allAgencies.reduce((acc, a) => ({...acc, [a.name]: a.ve_current}), {}) },
    ];
    return data;
  };
  const comparisonData = generateComparisonData();

  // Leaderboard logic
  const leaderboard = [...allAgencies].sort((a, b) => b.ve_current - a.ve_current);
  const myRank = leaderboard.findIndex(a => a.id === agency.id) + 1;

  return (
    <div className="space-y-6">
        {/* Header Stats */}
        <div className="flex flex-col md:flex-row justify-between items-end gap-4">
            <div>
                <h2 className="text-4xl md:text-5xl font-display font-bold text-slate-900 tracking-tight">{agency.name}</h2>
                <div className="flex items-center gap-3 mt-1">
                    <span className="bg-slate-900 text-white px-3 py-1 rounded-lg text-xs font-bold uppercase tracking-wider">Rang #{myRank}</span>
                    <span className="text-slate-500 italic">"{agency.tagline}"</span>
                </div>
            </div>
            <div className="text-right">
                <span className="text-xs font-bold text-slate-400 uppercase tracking-widest">Valeur Actuelle (VE)</span>
                <div className={`text-6xl font-display font-bold ${agency.ve_current >= 60 ? 'text-emerald-500' : agency.ve_current >= 40 ? 'text-amber-500' : 'text-red-500'}`}>
                    {agency.ve_current} <span className="text-xl text-slate-400 font-normal">pts</span>
                </div>
            </div>
        </div>

        {/* The Graph Card */}
        <div className="bg-white rounded-[32px] p-6 md:p-8 border border-slate-200 shadow-xl shadow-slate-200/50 relative overflow-hidden">
            <div className="flex justify-between items-center mb-6">
                <h3 className="text-lg font-bold text-slate-900 flex items-center gap-2">
                    <TrendingUp className="text-yellow-500" /> Market Overview
                </h3>
                {/* Mini Leaderboard */}
                <div className="hidden md:flex gap-2">
                    {leaderboard.slice(0, 3).map((a, i) => (
                        <div key={a.id} className={`flex items-center gap-2 px-3 py-1.5 rounded-full text-xs border ${a.id === agency.id ? 'bg-yellow-50 border-yellow-200' : 'bg-slate-50 border-slate-100'}`}>
                            <span className="font-bold text-slate-400">#{i+1}</span>
                            <span className={`font-bold ${a.id === agency.id ? 'text-yellow-600' : 'text-slate-700'}`}>{a.name}</span>
                        </div>
                    ))}
                </div>
            </div>

            <div className="h-[300px] w-full">
                <ResponsiveContainer width="100%" height="100%">
                    <LineChart data={comparisonData} margin={{ top: 10, right: 10, left: 0, bottom: 0 }}>
                        <CartesianGrid strokeDasharray="3 3" stroke="#f1f5f9" vertical={false} />
                        <XAxis dataKey="name" stroke="#94a3b8" fontSize={12} tickLine={false} axisLine={false} />
                        <YAxis stroke="#94a3b8" fontSize={12} tickLine={false} axisLine={false} domain={[0, 100]} />
                        <Tooltip 
                            contentStyle={{ backgroundColor: '#fff', border: '1px solid #e2e8f0', borderRadius: '12px', color: '#0f172a', boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)' }}
                            itemStyle={{ fontSize: '12px', fontWeight: 'bold' }}
                        />
                        <Legend wrapperStyle={{ paddingTop: '20px' }} />
                        {allAgencies.map((a, index) => (
                            <Line 
                                key={a.id}
                                type="monotone" 
                                dataKey={a.name} 
                                stroke={a.id === agency.id ? '#facc15' : index % 2 === 0 ? '#6366f1' : '#10b981'} 
                                strokeWidth={a.id === agency.id ? 4 : 2}
                                strokeOpacity={a.id === agency.id ? 1 : 0.2}
                                dot={a.id === agency.id ? {r: 6, fill: '#facc15', strokeWidth: 2, stroke: '#fff'} : false}
                                activeDot={{ r: 8 }}
                            />
                        ))}
                    </LineChart>
                </ResponsiveContainer>
            </div>
        </div>
    </div>
  );
};

