import React, { useState } from 'react';
import { Agency, Student } from '../../types';
import { Loader2, Wand2, Star, Award, Clock } from 'lucide-react';
import { generateAgencyNames } from '../../services/geminiService';
import { Modal } from '../Modal';

interface TeamViewProps {
  agency: Agency;
  onUpdateAgency: (agency: Agency) => void;
}

export const TeamView: React.FC<TeamViewProps> = ({ agency, onUpdateAgency }) => {
  const [isGenerating, setIsGenerating] = useState(false);
  const [selectedMember, setSelectedMember] = useState<Student | null>(null);

  const handleGenerateName = async () => {
    setIsGenerating(true);
    const suggestions = await generateAgencyNames(agency.constraints);
    if (suggestions.length > 0) {
      onUpdateAgency({
        ...agency,
        name: suggestions[0].name,
        tagline: suggestions[0].tagline
      });
    }
    setIsGenerating(false);
  };

  return (
    <div className="animate-in slide-in-from-right-4 duration-500">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {agency.members.map(member => (
                <div 
                    key={member.id} 
                    onClick={() => setSelectedMember(member)}
                    className="bg-white p-6 rounded-3xl border border-slate-100 shadow-sm flex items-center gap-6 group hover:shadow-md transition-all cursor-pointer hover:border-indigo-200"
                >
                    <img src={member.avatarUrl} className="w-20 h-20 rounded-2xl bg-slate-100 group-hover:scale-105 transition-transform" alt={member.name} />
                    <div className="flex-1">
                        <h3 className="text-xl font-bold text-slate-900 group-hover:text-indigo-600 transition-colors">{member.name}</h3>
                        <span className="inline-block mt-1 px-3 py-1 bg-slate-100 rounded-full text-xs font-bold text-slate-500 uppercase tracking-wider">{member.role}</span>
                    </div>
                    <div className="text-right">
                        <span className="block text-4xl font-display font-bold text-indigo-600">{member.individualScore}</span>
                        <span className="text-[10px] font-bold text-slate-400 uppercase">Score</span>
                    </div>
                </div>
            ))}
        </div>

        {agency.name === "Nouvelle Agence" && (
            <div className="mt-8 text-center p-8 bg-indigo-50 rounded-3xl border border-dashed border-indigo-200">
                <h4 className="text-indigo-900 font-bold mb-2">Besoin d'identité ?</h4>
                <p className="text-indigo-700/70 text-sm mb-4">L'IA peut générer un nom basé sur vos contraintes.</p>
                <button 
                    onClick={handleGenerateName} 
                    disabled={isGenerating}
                    className="px-6 py-3 bg-indigo-600 hover:bg-indigo-700 text-white font-bold rounded-xl transition-all flex items-center gap-2 mx-auto shadow-lg shadow-indigo-600/20"
                >
                    {isGenerating ? <Loader2 className="animate-spin" /> : <Wand2 />}
                    Générer Branding
                </button>
            </div>
        )}

        {/* MODAL: Détail Note Élève */}
        <Modal isOpen={!!selectedMember} onClose={() => setSelectedMember(null)} title="Bulletin Individuel">
            {selectedMember && (
                <div className="space-y-6">
                    <div className="flex items-center gap-4 mb-6">
                        <img src={selectedMember.avatarUrl} className="w-16 h-16 rounded-2xl bg-slate-100" />
                        <div>
                            <h4 className="text-xl font-bold text-slate-900">{selectedMember.name}</h4>
                            <p className="text-slate-500 text-sm">{selectedMember.role}</p>
                        </div>
                        <div className="ml-auto text-center">
                            <span className="block text-3xl font-display font-bold text-indigo-600">{selectedMember.individualScore}</span>
                            <span className="text-[10px] uppercase font-bold text-slate-400">Total / 100</span>
                        </div>
                    </div>

