import React, { useState } from 'react';
import { Agency, Student, GameEvent } from '../types';
import { ArrowRightLeft, UserMinus, UserPlus, ShieldAlert, Plus } from 'lucide-react';

interface AdminMercatoProps {
  agencies: Agency[];
  onUpdateAgencies: (agencies: Agency[]) => void;
}

export const AdminMercato: React.FC<AdminMercatoProps> = ({ agencies, onUpdateAgencies }) => {
  const [selectedStudentId, setSelectedStudentId] = useState<string | null>(null);
  const [targetAgencyId, setTargetAgencyId] = useState<string | null>(null);

  // Helper to find student and their current agency
  const findStudentData = (studentId: string) => {
    for (const agency of agencies) {
        const student = agency.members.find(m => m.id === studentId);
        if (student) return { student, agency };
    }
    return null;
  };

  const handleTransfer = () => {
    if (!selectedStudentId || !targetAgencyId) return;

    const sourceData = findStudentData(selectedStudentId);
    if (!sourceData) return;

    const { student, agency: sourceAgency } = sourceData;
    const targetAgency = agencies.find(a => a.id === targetAgencyId);

    if (!targetAgency || sourceAgency.id === targetAgency.id) return;

    // 1. Remove from Source
    const updatedSourceMembers = sourceAgency.members.filter(m => m.id !== student.id);
    const updatedSource = { ...sourceAgency, members: updatedSourceMembers };

    // 2. Add to Target
    const updatedTargetMembers = [...targetAgency.members, student];
    const updatedTarget = { ...targetAgency, members: updatedTargetMembers };

    // 3. Create Event Logs (Mercato Shock)
    // Source loses Stability
    const eventSource: GameEvent = {
        id: `evt-${Date.now()}-1`, date: new Date().toISOString().split('T')[0],
        type: 'VE_DELTA', label: 'Départ Staff', deltaVE: -5,
        description: `${student.name} a quitté l'agence pour ${targetAgency.name}.`
    };
    updatedSource.eventLog = [...updatedSource.eventLog, eventSource];
    updatedSource.ve_current = Math.max(0, updatedSource.ve_current - 5);

    // Target gains potential but chaos
    const eventTarget: GameEvent = {
        id: `evt-${Date.now()}-2`, date: new Date().toISOString().split('T')[0],
        type: 'VE_DELTA', label: 'Recrutement', deltaVE: -2,
        description: `${student.name} a rejoint l'équipe. Onboarding nécessaire.`
    };
    updatedTarget.eventLog = [...updatedTarget.eventLog, eventTarget];
    updatedTarget.ve_current = Math.max(0, updatedTarget.ve_current - 2);

    // Update State
    const newAgencies = agencies.map(a => 
        a.id === sourceAgency.id ? updatedSource : 
        a.id === targetAgency.id ? updatedTarget : a
    );

    onUpdateAgencies(newAgencies);
    setSelectedStudentId(null);
    setTargetAgencyId(null);
  };

  const handleCreateAgency = () => {
      const newAgency: Agency = {
          id: `a-${Date.now()}`,
          name: "Nouvelle Agence",
          tagline: "En construction...",
          ve_current: 50,
          status: 'stable',
          budget_real: 5000,
          budget_valued: 0,
          members: [],
          peerReviews: [],
          eventLog: [],
          currentCycle: agencies[0].currentCycle, // Copy cycle from first agency
          constraints: { space: "À définir", style: "À définir", client: "À définir" },
          progress: JSON.parse(JSON.stringify(agencies[0].progress)) // Clone structure
      };
      onUpdateAgencies([...agencies, newAgency]);
  };

  return (
    <div className="animate-in fade-in duration-500">
        <div className="flex justify-between items-center mb-6">
            <div>
                <h2 className="text-3xl font-display font-bold text-slate-900">Mercato</h2>
                <p className="text-slate-500 text-sm">Transférer des talents et gérer la composition des agences.</p>
            </div>
            <button 
                onClick={handleCreateAgency}
                className="bg-indigo-600 hover:bg-indigo-700 text-white px-4 py-2 rounded-xl font-bold text-sm flex items-center gap-2 transition-colors"
            >
                <Plus size={18} /> Créer un Groupe
            </button>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-12 gap-6">

            {/* LEFT: Student List */}
            <div className="lg:col-span-5 space-y-4">
                <h3 className="font-bold text-slate-900 flex items-center gap-2">
                    <UserMinus size={18} className="text-slate-400"/> Sélectionner un Talent
                </h3>
                <div className="bg-white rounded-2xl border border-slate-200 overflow-hidden max-h-[600px] overflow-y-auto">
                    {agencies.map(agency => (
                        <div key={agency.id} className="border-b border-slate-100 last:border-0">
                            <div className="bg-slate-50 px-4 py-2 text-xs font-bold text-slate-500 uppercase tracking-wider sticky top-0">
                                {agency.name} ({agency.members.length})
                            </div>
                            <div>
                                {agency.members.map(student => (
                                    <div 
                                        key={student.id}
                                        onClick={() => setSelectedStudentId(student.id)}
                                        className={`p-3 flex items-center gap-3 cursor-pointer transition-colors ${selectedStudentId === student.id ? 'bg-indigo-50 border-l-4 border-indigo-500' : 'hover:bg-slate-50 border-l-4 border-transparent'}`}
                                    >
                                        <img src={student.avatarUrl} className="w-8 h-8 rounded-full bg-slate-200" />
                                        <div>
                                            <p className="font-bold text-slate-900 text-sm">{student.name}</p>
                                            <p className="text-xs text-slate-500">{student.role}</p>
                                        </div>
                                    </div>
                                ))}
                                {agency.members.length === 0 && (
                                    <div className="p-3 text-xs text-slate-400 italic">Aucun membre</div>
                                )}
                            </div>
                        </div>
                    ))}
                </div>
            </div>

            {/* MIDDLE: Action Zone */}
            <div className="lg:col-span-2 flex flex-col items-center justify-center gap-4 py-8 lg:py-0">
                <div className={`w-12 h-12 rounded-full flex items-center justify-center transition-all ${selectedStudentId && targetAgencyId ? 'bg-indigo-600 text-white shadow-lg shadow-indigo-500/30 scale-110' : 'bg-slate-100 text-slate-300'}`}>
                    <ArrowRightLeft size={24} />
                </div>
                <button 
                    disabled={!selectedStudentId || !targetAgencyId}
                    onClick={handleTransfer}
                    className="w-full bg-slate-900 disabled:bg-slate-200 text-white disabled:text-slate-400 font-bold py-3 rounded-xl transition-all"
                >
                    Transférer
                </button>
            </div>

            {/* RIGHT: Target Agency */}
            <div className="lg:col-span-5 space-y-4">
                 <h3 className="font-bold text-slate-900 flex items-center gap-2">
                    <UserPlus size={18} className="text-slate-400"/> Destination
                </h3>
                 <div className="grid gap-3">
                    {agencies.map(agency => {
                        const isSource = selectedStudentId && agency.members.find(m => m.id === selectedStudentId);
                        return (
                            <button
                                key={agency.id}
                                disabled={!!isSource}
                                onClick={() => setTargetAgencyId(agency.id)}
                                className={`text-left p-4 rounded-xl border-2 transition-all ${
                                    targetAgencyId === agency.id 
                                    ? 'border-indigo-500 bg-indigo-50' 
                                    : isSource 
                                        ? 'border-slate-100 bg-slate-50 opacity-50 cursor-not-allowed'
                                        : 'border-slate-200 bg-white hover:border-slate-300'
                                }`}
                            >
                                <div className="flex justify-between items-center">
                                    <span className={`font-bold ${targetAgencyId === agency.id ? 'text-indigo-700' : 'text-slate-700'}`}>{agency.name}</span>
                                    {isSource && <span className="text-[10px] uppercase font-bold text-slate-400">Actuelle</span>}
                                </div>
                                <div className="text-xs text-slate-500 mt-1 flex gap-2">
                                    <span>VE: {agency.ve_current}</span>
                                    <span>•</span>
                                    <span>{agency.members.length} membres</span>
                                </div>
                            </button>
                        );
                    })}
                 </div>
            </div>
        </div>
    </div>
  );
};

