                                {deliverable.id === 'd_charter' ? 'Remplir Fiche' : 'Déposer'}
                            </button>
                            ) : (
                                <span className="px-4 py-2 bg-white border border-slate-200 rounded-lg text-xs font-bold text-slate-500">
                                    {deliverable.status === 'submitted' ? 'En attente...' : 'Validé'}
                                </span>
                            )}
                        </div>

                        {deliverable.feedback && (
                            <div className="mt-4 bg-indigo-50 p-4 rounded-xl flex gap-3 items-start">
                                <MessageSquare size={16} className="text-indigo-500 mt-0.5 shrink-0"/>
                                <p className="text-indigo-800 text-sm italic">"{deliverable.feedback}"</p>
                            </div>
                        )}
                    </div>
                ))}
            </div>
        </div>

        {/* MODAL: Charter Form */}
        <Modal isOpen={isCharterModalOpen} onClose={() => setIsCharterModalOpen(false)} title="Charte de Projet">
