interface GradingModalProps {
    isOpen: boolean;
    onClose: () => void;
    item: {agencyId: string, weekId: string, deliverable: Deliverable};
    agencies: Agency[];
    onUpdateAgency: (agency: Agency) => void;
}

const GradingModal: React.FC<GradingModalProps> = ({ isOpen, onClose, item, agencies, onUpdateAgency }) => {
    const [quality, setQuality] = useState<'A' | 'B' | 'C'>('B');
    const [daysLate, setDaysLate] = useState<number>(0);
    const [constraintBroken, setConstraintBroken] = useState<boolean>(false);

    // Feedback text (optional override)
    const [feedback, setFeedback] = useState(item.deliverable.feedback || "");

    const baseScore = quality === 'A' ? 10 : quality === 'B' ? 4 : 0;
    const penaltyLate = daysLate * 5;
    const penaltyConstraint = constraintBroken ? 10 : 0;
    const totalDelta = baseScore - penaltyLate - penaltyConstraint;

    const handleValidate = () => {
        const agency = agencies.find(a => a.id === item.agencyId);
        if(!agency) return;

        const currentWeek = agency.progress[item.weekId];

        // Update Deliverable
        const updatedDeliverables = currentWeek.deliverables.map(d => 
            d.id === item.deliverable.id 
            ? { 
                ...d, 
                status: 'validated' as const, 
                feedback: feedback,
                score: 100, // Conceptuel, grading.delta est la vraie valeur
                grading: {
                    quality,
                    daysLate,
                    constraintBroken,
                    finalDelta: totalDelta
                }
              }
            : d
        );

        // Create Event
        const newEvent: GameEvent = {
            id: `evt-${Date.now()}`,
            date: new Date().toISOString().split('T')[0],
            type: 'VE_DELTA',
            label: `Correction: ${item.deliverable.name}`,
            deltaVE: totalDelta,
            description: `Qualité ${quality} (${baseScore}pts) | Retard: ${daysLate}j (-${penaltyLate}) | Contrainte: ${constraintBroken ? 'Non' : 'Oui'} (-${penaltyConstraint})`
        };

        const updatedAgency = {
            ...agency,
            ve_current: Math.max(0, Math.min(100, agency.ve_current + totalDelta)), // Cap 0-100
            eventLog: [...agency.eventLog, newEvent],
            progress: {
                ...agency.progress,
                [item.weekId]: {
                    ...currentWeek,
                    deliverables: updatedDeliverables
                }
            }
        };

        onUpdateAgency(updatedAgency);
        onClose();
    };

    return (
        <Modal isOpen={isOpen} onClose={onClose} title="Correction de Livrable">
            <div className="space-y-6">

                {/* Header Info */}
                <div className="bg-slate-50 p-4 rounded-xl border border-slate-100">
                    <div className="flex items-center justify-between mb-2">
                        <span className="text-xs font-bold text-slate-400 uppercase tracking-widest">{item.weekId}</span>
                        <a href={item.deliverable.fileUrl || '#'} target="_blank" rel="noreferrer" className="text-xs font-bold text-indigo-600 hover:underline flex items-center gap-1">
                            Voir le fichier <ArrowRight size={10}/>
                        </a>
                    </div>
                    <h3 className="font-bold text-slate-900 text-lg leading-tight">{item.deliverable.name}</h3>
                    <p className="text-slate-500 text-sm mt-1">{item.deliverable.description}</p>
                </div>

                {/* --- CONTROLS --- */}
                <div className="space-y-5">

                    {/* 1. Quality */}
                    <div>
                        <label className="block text-sm font-bold text-slate-700 mb-2 flex items-center gap-2">
                            <Trophy size={16} className="text-yellow-500"/> Qualité du rendu
                        </label>
                        <div className="grid grid-cols-3 gap-2">
                            <button 
                                onClick={() => setQuality('A')}
                                className={`py-3 px-2 rounded-xl border-2 font-bold text-sm transition-all ${quality === 'A' ? 'border-emerald-500 bg-emerald-50 text-emerald-700' : 'border-slate-100 bg-white text-slate-400'}`}
                            >
                                A (Excellence)
                                <span className="block text-[10px] font-normal opacity-70">+10 pts</span>
                            </button>
                            <button 
                                onClick={() => setQuality('B')}
                                className={`py-3 px-2 rounded-xl border-2 font-bold text-sm transition-all ${quality === 'B' ? 'border-amber-500 bg-amber-50 text-amber-700' : 'border-slate-100 bg-white text-slate-400'}`}
                            >
                                B (Standard)
                                <span className="block text-[10px] font-normal opacity-70">+4 pts</span>
                            </button>
                            <button 
                                onClick={() => setQuality('C')}
                                className={`py-3 px-2 rounded-xl border-2 font-bold text-sm transition-all ${quality === 'C' ? 'border-slate-400 bg-slate-100 text-slate-600' : 'border-slate-100 bg-white text-slate-400'}`}
                            >
                                C (Rejeté)
                                <span className="block text-[10px] font-normal opacity-70">0 pts</span>
                            </button>
                        </div>
                    </div>

                    {/* 2. Penalties */}
                    <div className="grid grid-cols-2 gap-4">
                        <div>
                             <label className="block text-sm font-bold text-slate-700 mb-2 flex items-center gap-2">
                                <Clock size={16} className="text-slate-400"/> Retard (jours)
                            </label>
                            <div className="flex items-center gap-2">
                                <button onClick={() => setDaysLate(Math.max(0, daysLate - 1))} className="w-8 h-8 rounded-lg bg-slate-100 hover:bg-slate-200 font-bold">-</button>
                                <span className="font-mono font-bold w-8 text-center">{daysLate}</span>
                                <button onClick={() => setDaysLate(daysLate + 1)} className="w-8 h-8 rounded-lg bg-slate-100 hover:bg-slate-200 font-bold">+</button>
                            </div>
                            <p className="text-[10px] text-red-500 font-bold mt-1 h-4">{daysLate > 0 ? `-${daysLate * 5} pts` : ''}</p>
                        </div>

                        <div>
                             <label className="block text-sm font-bold text-slate-700 mb-2 flex items-center gap-2">
                                <Ban size={16} className="text-slate-400"/> Contraintes
                            </label>
                            <button 
                                onClick={() => setConstraintBroken(!constraintBroken)}
                                className={`w-full py-2 px-3 rounded-xl border transition-all text-xs font-bold ${constraintBroken ? 'bg-red-50 border-red-500 text-red-600' : 'bg-white border-slate-200 text-slate-400'}`}
                            >
                                {constraintBroken ? 'Non Respectées (-10)' : 'Respectées (OK)'}
                            </button>
                        </div>
                    </div>

                    {/* 3. Feedback */}
                    <div>
                        <label className="block text-sm font-bold text-slate-700 mb-2">Commentaire (Public)</label>
                        <textarea 
                            value={feedback}
                            onChange={(e) => setFeedback(e.target.value)}
                            className="w-full p-3 rounded-xl border border-slate-200 text-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 min-h-[80px]"
                        />
                    </div>
                </div>

                {/* --- TOTAL & ACTIONS --- */}
                <div className="bg-slate-900 rounded-2xl p-4 text-white flex items-center justify-between shadow-xl shadow-slate-900/10">
                    <div>
                        <span className="block text-[10px] uppercase font-bold text-slate-400 tracking-wider">Impact VE Calculé</span>
                        <div className="flex items-baseline gap-2">
                            <span className={`text-3xl font-display font-bold ${totalDelta > 0 ? 'text-emerald-400' : totalDelta < 0 ? 'text-red-400' : 'text-white'}`}>
                                {totalDelta > 0 ? '+' : ''}{totalDelta}
                            </span>
                            <span className="text-sm font-bold opacity-60">points</span>
                        </div>
                    </div>
                    <button 
                        onClick={handleValidate}
                        className="bg-white text-slate-900 px-6 py-3 rounded-xl font-bold hover:bg-indigo-50 transition-colors flex items-center gap-2"
                    >
                        <Calculator size={18}/>
                        Valider
                    </button>
                </div>
            </div>
        </Modal>
    );
}

import React, { useState } from 'react';
import { Agency, Student, GameEvent } from '../types';
import { ArrowRightLeft, UserMinus, UserPlus, Briefcase, Plus, AlertCircle } from 'lucide-react';

interface AdminMercatoProps {
  agencies: Agency[];
  onUpdateAgencies: (agencies: Agency[]) => void;
}

export const AdminMercato: React.FC<AdminMercatoProps> = ({ agencies, onUpdateAgencies }) => {
  const [selectedStudentId, setSelectedStudentId] = useState<string | null>(null);
  const [targetAgencyId, setTargetAgencyId] = useState<string | null>(null);

  // Separate Unassigned (Chômage) from Active Agencies
  const unassignedAgency = agencies.find(a => a.id === 'unassigned');
  const activeAgencies = agencies.filter(a => a.id !== 'unassigned');

  // Helper to find student and their current agency
  const findStudentData = (studentId: string) => {
    for (const agency of agencies) {
        const student = agency.members.find(m => m.id === studentId);
        if (student) return { student, agency };
    }
    return null;
  };

  const getTransferType = (sourceId: string, targetId: string) => {
      if (sourceId === 'unassigned') return 'HIRE';
      if (targetId === 'unassigned') return 'FIRE';
      return 'TRANSFER';
  }

  const handleTransfer = () => {
    if (!selectedStudentId || !targetAgencyId) return;

    const sourceData = findStudentData(selectedStudentId);
    if (!sourceData) return;

    const { student, agency: sourceAgency } = sourceData;
    const targetAgency = agencies.find(a => a.id === targetAgencyId);

    if (!targetAgency || sourceAgency.id === targetAgency.id) return;

    const transferType = getTransferType(sourceAgency.id, targetAgency.id);

    // 1. Remove from Source
    const updatedSourceMembers = sourceAgency.members.filter(m => m.id !== student.id);
    const updatedSource = { ...sourceAgency, members: updatedSourceMembers };

    // 2. Add to Target
    const updatedTargetMembers = [...targetAgency.members, student];
    const updatedTarget = { ...targetAgency, members: updatedTargetMembers };

    // 3. Create Event Logs
    let eventSource: GameEvent | null = null;
    let eventTarget: GameEvent | null = null;
    let sourceVEDelta = 0;
    let targetVEDelta = 0;

    if (transferType === 'FIRE') {
        // Source (Agency) Fires Student -> Huge penalty for instability
        sourceVEDelta = -15;
        eventSource = {
            id: `evt-${Date.now()}-1`, date: new Date().toISOString().split('T')[0],
            type: 'CRISIS', label: 'Licenciement', deltaVE: sourceVEDelta,
            description: `${student.name} a été licencié. Instabilité majeure.`
        };
    } else if (transferType === 'HIRE') {
        // Target (Agency) Hires from Pool -> Small penalty for onboarding
        targetVEDelta = -5;
        eventTarget = {
            id: `evt-${Date.now()}-2`, date: new Date().toISOString().split('T')[0],
            type: 'VE_DELTA', label: 'Recrutement Ext.', deltaVE: targetVEDelta,
            description: `${student.name} rejoint l'équipe depuis le vivier. Onboarding requis.`
        };
    } else {
        // Classic Transfer
        sourceVEDelta = -5;
        targetVEDelta = -2;
        eventSource = {
            id: `evt-${Date.now()}-1`, date: new Date().toISOString().split('T')[0],
            type: 'VE_DELTA', label: 'Départ Staff', deltaVE: sourceVEDelta,
            description: `${student.name} a quitté l'agence pour ${targetAgency.name}.`
        };
        eventTarget = {
            id: `evt-${Date.now()}-2`, date: new Date().toISOString().split('T')[0],
            type: 'VE_DELTA', label: 'Transfert Entrant', deltaVE: targetVEDelta,
            description: `${student.name} a rejoint l'équipe par transfert.`
        };
    }

    if (eventSource && sourceAgency.id !== 'unassigned') {
        updatedSource.eventLog = [...updatedSource.eventLog, eventSource];
        updatedSource.ve_current = Math.max(0, updatedSource.ve_current + sourceVEDelta);
    }
    if (eventTarget && targetAgency.id !== 'unassigned') {
        updatedTarget.eventLog = [...updatedTarget.eventLog, eventTarget];
        updatedTarget.ve_current = Math.max(0, updatedTarget.ve_current + targetVEDelta);
    }

    // Update State
    const newAgencies = agencies.map(a => 
        a.id === sourceAgency.id ? updatedSource : 
        a.id === targetAgency.id ? updatedTarget : a
    );

    onUpdateAgencies(newAgencies);
    setSelectedStudentId(null);
    setTargetAgencyId(null);
  };

  const handleCreateAgency = () => {
      const newAgency: Agency = {
          id: `a-${Date.now()}`,
          name: "Nouvelle Agence",
          tagline: "En construction...",
          ve_current: 50,
          status: 'stable',
          budget_real: 5000,
          budget_valued: 0,
          members: [],
          peerReviews: [],
          eventLog: [],
          currentCycle: agencies[0].currentCycle,
          constraints: { space: "À définir", style: "À définir", client: "À définir" },
          projectDef: { problem: "", target: "", location: "", gesture: "", isLocked: false },
          progress: JSON.parse(JSON.stringify(agencies[0].progress))
      };
      onUpdateAgencies([...agencies, newAgency]);
  };

  const getActionLabel = () => {
    if (!selectedStudentId || !targetAgencyId) return "Sélectionner";
    const source = findStudentData(selectedStudentId)?.agency;
    if (!source) return "Erreur";

    const type = getTransferType(source.id, targetAgencyId);
    if (type === 'FIRE') return 'Licencier (Vers Chômage)';
    if (type === 'HIRE') return 'Recruter (Depuis Vivier)';
    return 'Transférer';
  }

  return (
    <div className="animate-in fade-in duration-500 pb-20">
        <div className="flex justify-between items-center mb-6">
            <div>
                <h2 className="text-3xl font-display font-bold text-slate-900">Mercato & RH</h2>
                <p className="text-slate-500 text-sm">Gérez les effectifs, les recrutements et les licenciements.</p>
            </div>
            <button 
                onClick={handleCreateAgency}
                className="bg-indigo-600 hover:bg-indigo-700 text-white px-4 py-2 rounded-xl font-bold text-sm flex items-center gap-2 transition-colors"
            >
                <Plus size={18} /> Créer un Groupe
            </button>
        </div>

        {/* --- ZONE 1: UNASSIGNED POOL (CHOMAGE) --- */}
        <div className="mb-8">
            <h3 className="text-sm font-bold text-slate-500 uppercase tracking-widest mb-3 flex items-center gap-2">
                <Briefcase size={16}/> Vivier / Pôle Chômage
            </h3>
            <div className={`border-2 border-dashed rounded-2xl p-4 transition-colors ${targetAgencyId === 'unassigned' ? 'bg-red-50 border-red-300' : 'bg-slate-100 border-slate-300'}`}>

                {/* As Target Button */}
                <div className="flex justify-between items-center mb-4">
                     <p className="text-sm text-slate-500 italic">
                        Les étudiants ici ne sont affiliés à aucune agence. Ils ne génèrent pas de valeur.
                     </p>
                     <button 
                        onClick={() => setTargetAgencyId('unassigned')}
                        disabled={selectedStudentId ? findStudentData(selectedStudentId)?.agency.id === 'unassigned' : true}
                        className={`px-4 py-2 rounded-lg text-xs font-bold transition-all ${
                            targetAgencyId === 'unassigned' 
                            ? 'bg-red-600 text-white ring-2 ring-red-300' 
                            : 'bg-white text-slate-600 border border-slate-200 hover:border-red-300 hover:text-red-500 disabled:opacity-50 disabled:cursor-not-allowed'
                        }`}
                     >
                        Définir comme Destination (Licenciement)
                     </button>
                </div>

                {/* List of Unemployed */}
                {unassignedAgency && unassignedAgency.members.length > 0 ? (
                    <div className="flex flex-wrap gap-3">
                        {unassignedAgency.members.map(student => (
                            <div 
                                key={student.id}
                                onClick={() => setSelectedStudentId(student.id)}
                                className={`flex items-center gap-3 p-3 rounded-xl cursor-pointer border-2 transition-all ${
                                    selectedStudentId === student.id 
                                    ? 'bg-white border-indigo-500 shadow-md transform scale-105' 
                                    : 'bg-white border-slate-200 hover:border-indigo-300'
                                }`}
                            >
                                <img src={student.avatarUrl} className="w-8 h-8 rounded-full bg-slate-200 grayscale" />
                                <div>
                                    <p className="font-bold text-slate-700 text-sm">{student.name}</p>
