export interface PeerReview {
  id: string;
  date: string;
  weekId: string;
  reviewerId: string;
  reviewerName: string;
  targetId: string;
  targetName: string;
  ratings: {
    attendance: number; // 1-5
    quality: number; // 1-5
    involvement: number; // 1-5
  };
  comment: string;
}

export interface Deliverable {
  id: string;
  name: string;
  description: string;
  status: 'pending' | 'submitted' | 'validated' | 'rejected';
  score?: number; // 0-100
  feedback?: string;
  fileUrl?: string;
  // Grading Details
  submissionDate?: string;
  grading?: {
    quality: 'A' | 'B' | 'C' | 'REJECTED';
    daysLate: number;
    constraintBroken: boolean;
    finalDelta: number;
  }
}

export interface WeekModule {
  id: string;
  title: string;
  type: 'FUN/CHILL' | 'THÉORIE' | 'TECHNIQUE' | 'JURY';
