import React, { useState, useMemo } from 'react';
import { Agency, Student, GameEvent, MercatoRequest } from '../types';
import { ArrowRightLeft, UserMinus, UserPlus, Briefcase, Plus, AlertCircle, Check, X, FileSearch, UserX } from 'lucide-react';

interface AdminMercatoProps {
  agencies: Agency[];
  onUpdateAgencies: (agencies: Agency[]) => void;
}

export const AdminMercato: React.FC<AdminMercatoProps> = ({ agencies, onUpdateAgencies }) => {
  const [selectedStudentId, setSelectedStudentId] = useState<string | null>(null);
  const [targetAgencyId, setTargetAgencyId] = useState<string | null>(null);

  // Separate Unassigned (Chômage) from Active Agencies
  const unassignedAgency = agencies.find(a => a.id === 'unassigned');
  const activeAgencies = agencies.filter(a => a.id !== 'unassigned');

  // Collect all Pending Requests
  const pendingRequests = useMemo(() => {
      const requests: {req: MercatoRequest, agency: Agency}[] = [];
      agencies.forEach(a => {
          a.mercatoRequests.forEach(r => {
              if (r.status === 'PENDING') requests.push({req: r, agency: a});
          });
      });
      return requests;
  }, [agencies]);

  // Helper to find student and their current agency
  const findStudentData = (studentId: string) => {
    for (const agency of agencies) {
        const student = agency.members.find(m => m.id === studentId);
        if (student) return { student, agency };
    }
    return null;
  };

  const executeTransfer = (studentId: string, sourceAgencyId: string, targetAgencyId: string, transferType: 'HIRE' | 'FIRE' | 'TRANSFER') => {
    const sourceAgency = agencies.find(a => a.id === sourceAgencyId);
    const targetAgency = agencies.find(a => a.id === targetAgencyId);
    const student = sourceAgency?.members.find(m => m.id === studentId);

    if (!sourceAgency || !targetAgency || !student) return;

    // 1. Remove from Source
    const updatedSourceMembers = sourceAgency.members.filter(m => m.id !== student.id);
    const updatedSource = { ...sourceAgency, members: updatedSourceMembers };

    // 2. Add to Target
    const updatedTargetMembers = [...targetAgency.members, student];
    const updatedTarget = { ...targetAgency, members: updatedTargetMembers };

    // 3. Events Logic
    let eventSource: GameEvent | null = null;
    let eventTarget: GameEvent | null = null;
    let sourceVEDelta = 0;
    let targetVEDelta = 0;

    if (transferType === 'FIRE') {
        // LOGIC CHANGE: Check Student Score
        if (student.individualScore < 50) {
            // Bad performance -> Good for Agency to fire them
            sourceVEDelta = 5;
            eventSource = {
                id: `evt-${Date.now()}-1`, date: new Date().toISOString().split('T')[0],
                type: 'VE_DELTA', label: 'Restructuration', deltaVE: sourceVEDelta,
                description: `Départ validé de ${student.name} (Score < 50). Optimisation de la masse salariale.`
            };
        } else {
            // Good performance -> Bad for Agency to lose them
            sourceVEDelta = -15;
            eventSource = {
                id: `evt-${Date.now()}-1`, date: new Date().toISOString().split('T')[0],
                type: 'CRISIS', label: 'Fuite de Cerveaux', deltaVE: sourceVEDelta,
                description: `Départ de ${student.name} (Score > 50). Perte de compétence clé.`
            };
        }
    } else if (transferType === 'HIRE') {
        targetVEDelta = -5;
        eventTarget = {
            id: `evt-${Date.now()}-2`, date: new Date().toISOString().split('T')[0],
            type: 'VE_DELTA', label: 'Recrutement Ext.', deltaVE: targetVEDelta,
            description: `${student.name} rejoint l'équipe depuis le vivier. Onboarding requis.`
        };
    } else {
         // Classic Transfer Logic (Manual)
         sourceVEDelta = -5;
         targetVEDelta = -2;
         // ... events
    }

    if (eventSource && sourceAgency.id !== 'unassigned') {
        updatedSource.eventLog = [...updatedSource.eventLog, eventSource];
        updatedSource.ve_current = Math.max(0, updatedSource.ve_current + sourceVEDelta);
    }
    if (eventTarget && targetAgency.id !== 'unassigned') {
        updatedTarget.eventLog = [...updatedTarget.eventLog, eventTarget];
        updatedTarget.ve_current = Math.max(0, updatedTarget.ve_current + targetVEDelta);
    }

    const newAgencies = agencies.map(a => 
        a.id === sourceAgency.id ? updatedSource : 
        a.id === targetAgency.id ? updatedTarget : a
    );
    return newAgencies;
  }

  const handleManualTransfer = () => {
     if (!selectedStudentId || !targetAgencyId) return;
     const sourceData = findStudentData(selectedStudentId);
     if (!sourceData) return;

     const type = sourceData.agency.id === 'unassigned' ? 'HIRE' : targetAgencyId === 'unassigned' ? 'FIRE' : 'TRANSFER';

     const newAgencies = executeTransfer(selectedStudentId, sourceData.agency.id, targetAgencyId, type);
     if(newAgencies) {
         onUpdateAgencies(newAgencies);
         setSelectedStudentId(null);
         setTargetAgencyId(null);
     }
  };

  const handleApproveRequest = (request: MercatoRequest, requestAgency: Agency) => {
      let newAgencies: Agency[] | undefined;

      if (request.type === 'FIRE') {
          // Student leaves Agency -> Go to Unassigned
          newAgencies = executeTransfer(request.studentId, request.targetAgencyId, 'unassigned', 'FIRE');
      } else if (request.type === 'HIRE') {
          // Agency hires Student -> From Unassigned to Agency
          newAgencies = executeTransfer(request.studentId, 'unassigned', request.targetAgencyId, 'HIRE');
      }

      if (newAgencies) {
          // Remove request from agency list
          const finalAgencies = newAgencies.map(a => {
             if (a.id === requestAgency.id) {
                 return { ...a, mercatoRequests: a.mercatoRequests.filter(r => r.id !== request.id) };
             }
             return a;
          });
          onUpdateAgencies(finalAgencies);
      }
  };

  const handleRejectRequest = (request: MercatoRequest, requestAgency: Agency) => {
      const updatedAgency = {
          ...requestAgency,
          mercatoRequests: requestAgency.mercatoRequests.filter(r => r.id !== request.id)
      };
      onUpdateAgencies(agencies.map(a => a.id === updatedAgency.id ? updatedAgency : a));
  };

  const handleCreateAgency = () => {
      const newAgency: Agency = {
          id: `a-${Date.now()}`,
          name: "Nouvelle Agence",
          tagline: "En construction...",
          ve_current: 50,
          status: 'stable',
          budget_real: 5000,
          budget_valued: 0,
          members: [],
          peerReviews: [],
          eventLog: [],
          currentCycle: agencies[0].currentCycle,
          constraints: { space: "À définir", style: "À définir", client: "À définir" },
          projectDef: { problem: "", target: "", location: "", gesture: "", isLocked: false },
          mercatoRequests: [],
          progress: JSON.parse(JSON.stringify(agencies[0].progress))
      };
      onUpdateAgencies([...agencies, newAgency]);
  };

  // UI Helpers
  const getTransferTypeLabel = (sourceId: string, targetId: string) => {
      if (sourceId === 'unassigned') return 'HIRE';
      if (targetId === 'unassigned') return 'FIRE';
      return 'TRANSFER';
  }

  const getActionLabel = () => {
    if (!selectedStudentId || !targetAgencyId) return "Sélectionner";
    const source = findStudentData(selectedStudentId)?.agency;
    if (!source) return "Erreur";

    const type = getTransferTypeLabel(source.id, targetAgencyId);
    if (type === 'FIRE') return 'Licencier (Vers Chômage)';
    if (type === 'HIRE') return 'Recruter (Depuis Vivier)';
    return 'Transférer';
  }

  return (
    <div className="animate-in fade-in duration-500 pb-20">
        <div className="flex justify-between items-center mb-6">
            <div>
                <h2 className="text-3xl font-display font-bold text-slate-900">Mercato & RH</h2>
                <p className="text-slate-500 text-sm">Gérez les effectifs, les recrutements et les licenciements.</p>
            </div>
            <button 
                onClick={handleCreateAgency}
                className="bg-indigo-600 hover:bg-indigo-700 text-white px-4 py-2 rounded-xl font-bold text-sm flex items-center gap-2 transition-colors"
            >
                <Plus size={18} /> Créer un Groupe
            </button>
        </div>

        {/* --- SECTION: PENDING REQUESTS --- */}
        {pendingRequests.length > 0 && (
            <div className="mb-8 bg-amber-50 border border-amber-200 rounded-2xl p-6">
                <h3 className="text-amber-800 font-bold flex items-center gap-2 mb-4">
                    <AlertCircle size={20}/> Demandes en attente ({pendingRequests.length})
                </h3>
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
                    {pendingRequests.map(({req, agency}) => {
                        const student = findStudentData(req.studentId)?.student;
                        const score = student?.individualScore || 0;
                        const isResignation = req.requesterId === req.studentId;

                        return (
                            <div key={req.id} className="bg-white p-4 rounded-xl border border-amber-100 shadow-sm flex flex-col gap-2">
                                <div className="flex justify-between items-start">
                                    <div className="flex items-center gap-2">
                                        <span className={`text-[10px] font-bold px-2 py-0.5 rounded-md uppercase ${req.type === 'HIRE' ? 'bg-emerald-100 text-emerald-700' : 'bg-red-100 text-red-700'}`}>
                                            {req.type === 'HIRE' ? 'Embauche' : (isResignation ? 'Démission' : 'Renvoi')}
                                        </span>
                                        <span className="text-xs text-slate-400">{req.date}</span>
                                    </div>
                                    <div className="flex gap-1">
                                        <button 
                                            onClick={() => handleRejectRequest(req, agency)}
                                            className="p-1.5 bg-slate-100 hover:bg-red-100 text-slate-400 hover:text-red-600 rounded-lg transition-colors"
                                        >
                                            <X size={16}/>
                                        </button>
                                        <button 
                                            onClick={() => handleApproveRequest(req, agency)}
                                            className="p-1.5 bg-slate-900 hover:bg-emerald-600 text-white rounded-lg transition-colors"
                                        >
                                            <Check size={16}/>
                                        </button>
                                    </div>
                                </div>

                                <div className="mt-1">
                                    <p className="font-bold text-slate-900 text-sm flex items-center gap-2">
                                        {req.studentName} 
                                        {req.type === 'HIRE' ? (
                                            <span className="text-xs text-emerald-600 font-normal">rejoint {agency.name}</span>
                                        ) : (
                                            <span className="text-xs text-red-600 font-normal">quitte {agency.name}</span>
                                        )}
                                    </p>
                                    {req.type === 'FIRE' && (
                                        <div className="flex items-center gap-2 mt-2 text-xs">
                                            <span className="text-slate-500">Score Élève:</span>
                                            <span className={`font-bold ${score < 50 ? 'text-red-500' : 'text-emerald-500'}`}>{score}/100</span>
                                            <span className="text-slate-300">|</span>
                                            {score < 50 ? (
                                                <span className="text-emerald-600 font-bold bg-emerald-50 px-2 py-0.5 rounded">+5 VE (Opti)</span>
                                            ) : (
                                                <span className="text-red-600 font-bold bg-red-50 px-2 py-0.5 rounded">-15 VE (Perte)</span>
                                            )}
                                        </div>
                                    )}
                                </div>

                                {req.type === 'HIRE' && student?.cvUrl && (
                                    <a href={student.cvUrl} target="_blank" className="text-xs text-indigo-600 hover:underline flex items-center gap-1 bg-indigo-50 p-2 rounded-lg justify-center font-bold">
                                        <FileSearch size={14}/> Voir le Dossier
                                    </a>
                                )}
                            </div>
                        );
                    })}
                </div>
            </div>
        )}

        {/* --- ZONE 1 & 2 (UNCHANGED) --- */}
        {/* Simplified rendering for brevity, keeping existing structure logic */}
        <div className="grid grid-cols-1 md:grid-cols-12 gap-6">
            <div className="md:col-span-12">
                 {/* UNASSIGNED POOL */}
                <h3 className="text-sm font-bold text-slate-500 uppercase tracking-widest mb-3 flex items-center gap-2">
                    <Briefcase size={16}/> Vivier / Pôle Chômage
                </h3>
                <div className={`border-2 border-dashed rounded-2xl p-4 mb-8 transition-colors ${targetAgencyId === 'unassigned' ? 'bg-red-50 border-red-300' : 'bg-slate-100 border-slate-300'}`}>
                     <div className="flex justify-between items-center mb-4">
                         <p className="text-sm text-slate-500 italic">Étudiants sans affectation.</p>
                         <button 
                            onClick={() => setTargetAgencyId('unassigned')}
                            className={`px-4 py-2 rounded-lg text-xs font-bold transition-all ${
                                targetAgencyId === 'unassigned' 
                                ? 'bg-red-600 text-white ring-2 ring-red-300' 
                                : 'bg-white text-slate-600 border border-slate-200 hover:border-red-300 hover:text-red-500'
                            }`}
                         >
                            Définir comme Destination (Licenciement)
                         </button>
                    </div>
                    {unassignedAgency && unassignedAgency.members.length > 0 ? (
                    <div className="flex flex-wrap gap-3">
                        {unassignedAgency.members.map(student => (
                            <div 
                                key={student.id}
                                onClick={() => setSelectedStudentId(student.id)}
                                className={`flex items-center gap-3 p-3 rounded-xl cursor-pointer border-2 transition-all ${
                                    selectedStudentId === student.id 
                                    ? 'bg-white border-indigo-500 shadow-md transform scale-105' 
                                    : 'bg-white border-slate-200 hover:border-indigo-300'
                                }`}
                            >
                                <img src={student.avatarUrl} className="w-8 h-8 rounded-full bg-slate-200 grayscale" />
                                <div>
                                    <p className="font-bold text-slate-700 text-sm">{student.name}</p>
                                    <div className="flex items-center gap-2">
                                        <p className="text-[10px] text-red-500 font-bold uppercase">Sans emploi</p>
                                        {student.cvUrl && <FileSearch size={12} className="text-indigo-500"/>}
                                    </div>
                                </div>
                            </div>
                        ))}
                    </div>
                    ) : (
                        <div className="text-center py-4 text-slate-400 text-sm font-bold">Aucun étudiant au chômage.</div>
                    )}
                </div>

                {/* ACTIVE AGENCIES */}
                <h3 className="text-sm font-bold text-slate-500 uppercase tracking-widest mb-3 flex items-center gap-2">
                    <UserPlus size={16}/> Agences Actives
                </h3>
                <div className="grid grid-cols-1 md:grid-cols-2 xl:grid-cols-3 gap-6">
                    {activeAgencies.map(agency => (
                        <div key={agency.id} className={`bg-white rounded-2xl border transition-all ${targetAgencyId === agency.id ? 'border-indigo-500 shadow-lg ring-2 ring-indigo-100' : 'border-slate-200 hover:border-slate-300'}`}>
                            <div 
                                onClick={() => setTargetAgencyId(agency.id)}
                                className={`p-4 border-b border-slate-100 flex justify-between items-center cursor-pointer rounded-t-2xl transition-colors ${targetAgencyId === agency.id ? 'bg-indigo-50' : 'bg-slate-50 hover:bg-slate-100'}`}
                            >
                                <h4 className={`font-bold ${targetAgencyId === agency.id ? 'text-indigo-700' : 'text-slate-700'}`}>{agency.name}</h4>
                                {targetAgencyId === agency.id && <span className="text-[10px] bg-indigo-200 text-indigo-800 px-2 rounded-full font-bold">Destination</span>}
                            </div>
                            <div className="p-4 space-y-2">
                                {agency.members.map(student => (
                                    <div 
                                        key={student.id}
                                        onClick={(e) => { e.stopPropagation(); setSelectedStudentId(student.id); }}
                                        className={`flex items-center gap-3 p-2 rounded-xl cursor-pointer transition-all ${
                                            selectedStudentId === student.id 
                                            ? 'bg-indigo-600 text-white shadow-md' 
                                            : 'hover:bg-slate-50 text-slate-700'
                                        }`}
                                    >
                                        <img src={student.avatarUrl} className={`w-8 h-8 rounded-full ${selectedStudentId === student.id ? 'bg-indigo-500' : 'bg-slate-200'}`} />
                                        <div className="flex-1">
                                            <div className="flex justify-between items-center">
                                                <p className="font-bold text-sm leading-none">{student.name}</p>
                                                <span className={`text-[10px] font-bold ${student.individualScore < 50 ? 'text-red-400' : 'text-emerald-400'}`}>{student.individualScore} pts</span>
                                            </div>
                                            <p className={`text-[10px] mt-0.5 ${selectedStudentId === student.id ? 'text-indigo-200' : 'text-slate-400'}`}>{student.role}</p>
                                        </div>
                                    </div>
                                ))}
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>

        {/* FLOATING ACTION BAR */}
        <div className={`fixed bottom-6 left-1/2 transform -translate-x-1/2 md:ml-32 bg-slate-900 text-white px-6 py-4 rounded-2xl shadow-2xl flex items-center gap-6 transition-all duration-300 z-50 ${selectedStudentId && targetAgencyId ? 'translate-y-0 opacity-100' : 'translate-y-24 opacity-0 pointer-events-none'}`}>
            <div className="flex items-center gap-3">
                 <div className="text-right">
                    <span className="block text-[10px] text-slate-400 uppercase font-bold">Source</span>
                    <span className="font-bold">{selectedStudentId ? findStudentData(selectedStudentId)?.agency.name : '-'}</span>
                 </div>
                 <ArrowRightLeft className="text-slate-500" />
                 <div>
                    <span className="block text-[10px] text-slate-400 uppercase font-bold">Cible</span>
                    <span className="font-bold">{targetAgencyId === 'unassigned' ? 'Chômage' : agencies.find(a => a.id === targetAgencyId)?.name}</span>
                 </div>
            </div>
            <button 
                onClick={handleManualTransfer}
                className={`px-6 py-2 rounded-xl font-bold text-sm transition-colors ${
                    getActionLabel().includes('Licencier') ? 'bg-red-500 hover:bg-red-600 text-white' : 
                    getActionLabel().includes('Recruter') ? 'bg-emerald-500 hover:bg-emerald-600 text-white' : 
                    'bg-white text-slate-900 hover:bg-indigo-50'
                }`}
            >
                {getActionLabel()} (Force)
            </button>
        </div>
    </div>
  );
};

import React, { useState } from 'react';
import { Agency, Student, MercatoRequest } from '../../types';
import { Briefcase, UserPlus, UserMinus, FileText, Upload, Clock, AlertTriangle, FileSearch, UserX } from 'lucide-react';
import { Modal } from '../Modal';

interface MercatoViewProps {
  agency: Agency;
  allAgencies: Agency[];
  onUpdateAgency: (agency: Agency) => void;
  onUpdateAgencies: (agencies: Agency[]) => void; // Need global update access
}

export const MercatoView: React.FC<MercatoViewProps> = ({ agency, allAgencies, onUpdateAgency, onUpdateAgencies }) => {
  const [isCVModalOpen, setIsCVModalOpen] = useState(false);
  const [cvUrlInput, setCvUrlInput] = useState('');

  const unemployedAgency = allAgencies.find(a => a.id === 'unassigned');
  const unemployedStudents = unemployedAgency ? unemployedAgency.members : [];

  // Current user mock (first member of current agency)
  const currentUser = agency.members[0];

  const handleHireRequest = (student: Student) => {
    const newRequest: MercatoRequest = {
        id: `req-${Date.now()}`,
        type: 'HIRE',
        studentId: student.id,
        studentName: student.name,
        requesterId: currentUser.id,
        targetAgencyId: agency.id,
        status: 'PENDING',
        date: new Date().toISOString().split('T')[0]
    };

    onUpdateAgency({
        ...agency,
        mercatoRequests: [...agency.mercatoRequests, newRequest]
    });
    alert(`Proposition d'embauche envoyée pour ${student.name}. L'enseignant doit valider.`);
  };

  // Self Resignation
  const handleResignationRequest = () => {
    const newRequest: MercatoRequest = {
        id: `req-${Date.now()}`,
        type: 'FIRE',
        studentId: currentUser.id,
        studentName: currentUser.name,
        requesterId: currentUser.id, // Self
        targetAgencyId: agency.id,
        status: 'PENDING',
        date: new Date().toISOString().split('T')[0]
    };

    onUpdateAgency({
        ...agency,
        mercatoRequests: [...agency.mercatoRequests, newRequest]
    });
  };

  // Firing a colleague
  const handleFireColleagueRequest = (colleague: Student) => {
      const isDangerous = colleague.individualScore >= 50;
      const message = isDangerous 
        ? `Attention ! ${colleague.name} a un bon score (${colleague.individualScore}). Son licenciement sera considéré comme une perte de compétence et pénalisera la VE (-15). Continuer ?`
        : `Le score de ${colleague.name} est critique (${colleague.individualScore}). Son départ pourrait optimiser la structure (+5 VE). Confirmer ?`;

      if (window.confirm(message)) {
        const newRequest: MercatoRequest = {
            id: `req-${Date.now()}`,
            type: 'FIRE',
            studentId: colleague.id,
            studentName: colleague.name,
            requesterId: currentUser.id, // By Me
            targetAgencyId: agency.id,
            status: 'PENDING',
            date: new Date().toISOString().split('T')[0]
        };
        onUpdateAgency({
            ...agency,
            mercatoRequests: [...agency.mercatoRequests, newRequest]
        });
      }
  };

  const handleUploadCV = () => {
    if(!currentUser || !cvUrlInput) return;
    const updatedMembers = agency.members.map(m => 
        m.id === currentUser.id ? { ...m, cvUrl: cvUrlInput } : m
    );
    onUpdateAgency({
        ...agency,
        members: updatedMembers
    });
    setIsCVModalOpen(false);
  };

  const hasPendingResignation = agency.mercatoRequests.find(r => r.studentId === currentUser?.id && r.requesterId === currentUser?.id && r.type === 'FIRE' && r.status === 'PENDING');

  // VIEW FOR UNEMPLOYED
  if (agency.id === 'unassigned') {
      return (
          <div className="animate-in fade-in space-y-6">
              <div className="bg-red-50 border-l-4 border-red-500 p-6 rounded-r-xl">
                  <h3 className="text-red-700 font-bold text-lg flex items-center gap-2">
                      <Briefcase size={24}/> Statut: Sans Emploi
                  </h3>
                  <p className="text-red-600/80 mt-1 text-sm">
                      Vous ne faites partie d'aucune agence active. Vous devez impérativement déposer votre CV pour espérer être recruté.
                  </p>
              </div>

              <div className="bg-white p-6 rounded-2xl border border-slate-200 shadow-sm">
                  <div className="flex justify-between items-center mb-4">
                      <h4 className="font-bold text-slate-900">Mon Dossier Professionnel</h4>
                      {currentUser?.cvUrl && <span className="text-xs bg-emerald-100 text-emerald-700 px-2 py-1 rounded-full font-bold">CV en ligne</span>}
                  </div>

                  {currentUser?.cvUrl ? (
                      <div className="flex items-center gap-4 p-4 bg-slate-50 rounded-xl border border-slate-200">
                           <FileText size={32} className="text-indigo-500"/>
                           <div className="flex-1 overflow-hidden">
                                <p className="font-bold text-slate-900 truncate">CV_{currentUser.name.replace(' ', '_')}.pdf</p>
                                <a href={currentUser.cvUrl} target="_blank" className="text-xs text-indigo-600 hover:underline">Voir le document</a>
                           </div>
                           <button onClick={() => setIsCVModalOpen(true)} className="p-2 hover:bg-slate-200 rounded-lg text-slate-500">
                                <Upload size={18}/>
                           </button>
                      </div>
                  ) : (
                      <button 
                        onClick={() => setIsCVModalOpen(true)}
                        className="w-full py-8 border-2 border-dashed border-slate-300 rounded-xl text-slate-400 hover:bg-slate-50 hover:border-indigo-400 hover:text-indigo-500 transition-all flex flex-col items-center gap-2"
                      >
                          <Upload size={32}/>
                          <span className="font-bold text-sm">Déposer mon CV (PDF)</span>
                      </button>
                  )}
              </div>

              <Modal isOpen={isCVModalOpen} onClose={() => setIsCVModalOpen(false)} title="Mettre à jour mon CV">
                  <div className="space-y-4">
                      <p className="text-sm text-slate-500">Collez le lien vers votre portfolio ou CV (Google Drive, Notion, etc).</p>
                      <input 
                        type="url" 
                        placeholder="https://..." 
                        value={cvUrlInput}
                        onChange={e => setCvUrlInput(e.target.value)}
                        className="w-full p-3 border border-slate-300 rounded-xl"
                      />
                      <button onClick={handleUploadCV} className="w-full bg-slate-900 text-white font-bold py-3 rounded-xl">Enregistrer</button>
                  </div>
              </Modal>
          </div>
      );
  }

  // VIEW FOR AGENCY MEMBERS
  return (
    <div className="animate-in fade-in space-y-8">

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            {/* LEFT: MY STATUS */}
            <div className="bg-white p-6 rounded-2xl border border-slate-200 shadow-sm">
                <h3 className="font-bold text-slate-900 mb-4 flex items-center gap-2">
                    <UserMinus size={20} className="text-slate-400"/> Mon Statut
                </h3>
                <div className="flex justify-between items-center mb-4">
                    <div>
                        <p className="text-sm text-slate-500">Score Individuel</p>
                        <p className={`text-2xl font-bold ${currentUser?.individualScore < 50 ? 'text-red-500' : 'text-slate-900'}`}>
                            {currentUser?.individualScore}/100
                        </p>
                    </div>
                </div>
                {hasPendingResignation ? (
                    <div className="bg-amber-50 text-amber-700 px-4 py-2 rounded-xl border border-amber-200 text-sm font-bold flex items-center gap-2">
                        <Clock size={16}/> Démission en cours
                    </div>
                ) : (
                    <button 
                        onClick={handleResignationRequest}
                        className="w-full px-4 py-2 bg-red-50 hover:bg-red-100 text-red-600 border border-red-200 rounded-xl font-bold text-sm transition-colors"
                    >
                        Demander ma démission
                    </button>
                )}
            </div>

            {/* RIGHT: TEAM MANAGEMENT (FIRE OTHERS) */}
            <div className="bg-white p-6 rounded-2xl border border-slate-200 shadow-sm">
                <h3 className="font-bold text-slate-900 mb-4 flex items-center gap-2">
                    <UserX size={20} className="text-slate-400"/> Gestion d'Effectif
                </h3>
                <div className="space-y-3">
                    {agency.members.filter(m => m.id !== currentUser.id).map(colleague => {
                        const isPendingFire = agency.mercatoRequests.some(r => r.type === 'FIRE' && r.studentId === colleague.id && r.status === 'PENDING');
                        return (
                            <div key={colleague.id} className="flex items-center justify-between p-2 bg-slate-50 rounded-xl">
                                <div className="flex items-center gap-3">
                                    <img src={colleague.avatarUrl} className="w-8 h-8 rounded-full bg-slate-200" />
                                    <div>
                                        <p className="font-bold text-sm text-slate-800">{colleague.name}</p>
                                        <p className={`text-[10px] font-bold ${colleague.individualScore < 50 ? 'text-red-500' : 'text-emerald-500'}`}>
                                            Score: {colleague.individualScore}
                                        </p>
                                    </div>
                                </div>
                                {isPendingFire ? (
                                    <span className="text-[10px] bg-amber-100 text-amber-700 px-2 py-1 rounded font-bold">En cours</span>
                                ) : (
                                    <button 
                                        onClick={() => handleFireColleagueRequest(colleague)}
                                        className="p-2 text-slate-400 hover:text-red-600 hover:bg-red-50 rounded-lg transition-colors"
                                        title="Proposer le licenciement"
                                    >
                                        <UserX size={16}/>
                                    </button>
                                )}
                            </div>
                        );
                    })}
                </div>
            </div>
        </div>

        {/* SECTION 2: RECRUITMENT POOL */}
        <div>
            <h3 className="font-bold text-slate-900 mb-4 flex items-center gap-2">
                <UserPlus size={20} className="text-emerald-500"/> Vivier de Talents (Chômage)
            </h3>

            {unemployedStudents.length === 0 ? (
                <div className="text-center py-12 bg-slate-50 rounded-2xl border border-dashed border-slate-200 text-slate-400">
                    <Briefcase size={32} className="mx-auto mb-2 opacity-50"/>
                    <p className="font-bold text-sm">Le marché est vide.</p>
                    <p className="text-xs">Aucun étudiant n'est actuellement sans emploi.</p>
                </div>
            ) : (
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    {unemployedStudents.map(student => {
                        const isPending = agency.mercatoRequests.some(r => r.type === 'HIRE' && r.studentId === student.id && r.status === 'PENDING');
                        return (
                            <div key={student.id} className="bg-white p-4 rounded-xl border border-slate-200 shadow-sm flex flex-col gap-3">
                                <div className="flex items-center gap-3">
                                    <img src={student.avatarUrl} className="w-10 h-10 rounded-full bg-slate-100 grayscale" />
                                    <div>
                                        <p className="font-bold text-slate-900">{student.name}</p>
                                        <p className="text-xs text-slate-500">{student.role}</p>
                                    </div>
                                    <div className="ml-auto">
                                        {student.cvUrl ? (
                                            <a href={student.cvUrl} target="_blank" className="p-2 bg-indigo-50 text-indigo-600 rounded-lg block hover:bg-indigo-100" title="Voir CV">
                                                <FileSearch size={18}/>
                                            </a>
                                        ) : (
                                            <span className="text-xs text-slate-300 italic">Pas de CV</span>
                                        )}
                                    </div>
                                </div>

                                {isPending ? (
                                    <button disabled className="w-full py-2 bg-slate-100 text-slate-400 font-bold rounded-lg text-xs cursor-not-allowed">
                                        Offre envoyée...
                                    </button>
                                ) : (
                                    <button 
                                        onClick={() => handleHireRequest(student)}
                                        className="w-full py-2 bg-slate-900 hover:bg-emerald-600 text-white font-bold rounded-lg text-xs transition-colors"
                                    >
                                        Proposer une embauche
                                    </button>
                                )}
                            </div>
                        );
                    })}
                </div>
            )}
        </div>
    </div>
  );
};

export enum CycleType {
  MARQUE_BRIEF = "Cycle 1: Marque & Brief",
  NARRATION_IA = "Cycle 2: Narration & IA",
  LOOKDEV = "Cycle 3: Look-dev & Sélection",
  PACKAGING = "Cycle 4: Packaging & Soutenance"
}

export interface PeerReview {
  id: string;
  date: string;
  weekId: string;
  reviewerId: string;
  reviewerName: string;
  targetId: string;
  targetName: string;
  ratings: {
    attendance: number; // 1-5
    quality: number; // 1-5
    involvement: number; // 1-5
  };
  comment: string;
}

export interface Deliverable {
  id: string;
  name: string;
  description: string;
  status: 'pending' | 'submitted' | 'validated' | 'rejected';
  score?: number; // 0-100
  feedback?: string;
  fileUrl?: string;
  // Grading Details
  submissionDate?: string;
  grading?: {
    quality: 'A' | 'B' | 'C' | 'REJECTED';
    daysLate: number;
    constraintBroken: boolean;
    finalDelta: number;
  }
}

export interface WeekModule {
  id: string;
  title: string;
  type: 'FUN/CHILL' | 'THÉORIE' | 'TECHNIQUE' | 'JURY';
  objectives: string[];
  deliverables: Deliverable[];
  locked: boolean;
  status?: 'pending' | 'in_progress' | 'validated';
}

export interface Student {
  id: string;
  name: string;
  role: 'Creative Director' | '3D Artist' | 'Motion Designer' | 'Producer';
  avatarUrl: string;
  individualScore: number; // 0-100
  cvUrl?: string; // URL vers le PDF du CV
  classId: 'A' | 'B'; // Gestion des deux promotions
}

export type EventType = 'CRISIS' | 'VE_DELTA' | 'BUDGET_DELTA' | 'CHECKPOINT' | 'INFO';

export interface GameEvent {
  id: string;
  date: string; // ISO String
  type: EventType;
  label: string; // Titre court (ex: "Pénurie matériaux")
  description?: string;
  deltaVE?: number; // Impact sur la VE (ex: -15)
  deltaBudgetReal?: number;
  deltaBudgetValued?: number;
}

export interface ProjectDefinition {
  problem: string;      // Problème réel et local
  target: string;       // Qui souffre (Persona)
  location: string;     // Où ça se passe
  gesture: string;      // Geste architectural unique
  isLocked: boolean;    // Validé par le prof ?
}

export interface MercatoRequest {
  id: string;
  type: 'HIRE' | 'FIRE'; // HIRE = Agence veut un chômeur, FIRE = Étudiant veut partir
  studentId: string; // La cible du mouvement
  studentName: string;
  requesterId?: string; // Qui a fait la demande (pour différencier démission/renvoi)
  targetAgencyId: string; // L'agence concernée
  status: 'PENDING' | 'REJECTED';
  date: string;
}

export interface Agency {
  id: string;
  name: string;
  tagline: string;
  logoUrl?: string;
  members: Student[];
  peerReviews: PeerReview[];
  classId: 'A' | 'B' | 'ALL'; // ALL pour l'agence Chômage

  // Data Driven by Events
  ve_current: number; // 0-100 (La note/valeur)
  budget_real: number; // En XOF ou €
  budget_valued: number; // En XOF ou €

  status: 'stable' | 'fragile' | 'critique';

  eventLog: GameEvent[]; // Source of Truth

  currentCycle: CycleType;

  // New Project Structure
  projectDef: ProjectDefinition;

  // Mercato Requests (Pending)
  mercatoRequests: MercatoRequest[];

  // Legacy constraints
  constraints: {
    space: string;
    style: string;
    client: string;
  };

  progress: {
    [weekId: string]: WeekModule;
  };
}

export interface AppState {
  userRole: 'admin' | 'student';
  selectedAgencyId: string | null;
  agencies: Agency[];
}

