const generateMockAgencies = (): Agency[] => {
  const agencies: Agency[] = [];
  let studentCursor = 0;

  // 12 Teams for 42 students
  // Teams 1-6 = Class A (24 students)
  // Teams 7-12 = Class B (18 students)
  for (let i = 1; i <= 12; i++) {
    const isClassA = i <= 6;
    const membersCount = isClassA ? 4 : 3;
    const classId = isClassA ? 'A' : 'B';
    const members = generateStudents(studentCursor, membersCount, classId);
    studentCursor += membersCount;

    agencies.push({
      id: `a${i}`,
      name: `Équipe ${i}`,
      tagline: "En attente de définition...",
      ve_current: 50,
      status: 'stable',
      classId: classId,
      budget_real: 5000,
      budget_valued: 0,
      eventLog: [
         { id: `e${i}-1`, date: "2024-02-01", type: "VE_DELTA", label: "Création Agence", deltaVE: 50, description: "Capital de départ" }
      ],
      members: members,
      peerReviews: [],
      currentCycle: CycleType.MARQUE_BRIEF,
      projectDef: {
        problem: "",
        target: "",
        location: "",
        gesture: "",
        isLocked: false
      },
      mercatoRequests: [],
      constraints: { space: "", style: "", client: "" }, // Legacy / Empty
      progress: JSON.parse(JSON.stringify(INITIAL_WEEKS))
    });
  }

  // Add the "Unassigned" Agency (Chômage Pool)
  agencies.push({
      id: 'unassigned',
      name: "Vivier / Chômage",
      tagline: "En recherche d'opportunité",
      ve_current: 0,
      status: 'critique',
      classId: 'ALL', // Holds students from both A and B
      budget_real: 0,
      budget_valued: 0,
      eventLog: [],
      members: [], // Starts empty, will be filled by firing
      peerReviews: [],
      currentCycle: CycleType.MARQUE_BRIEF,
      projectDef: { problem: "", target: "", location: "", gesture: "", isLocked: true },
      mercatoRequests: [],
      constraints: { space: "", style: "", client: "" },
      progress: {}
  });

  return agencies;
};

