const generateMockAgencies = (): Agency[] => {
  const agencies: Agency[] = [];
  let globalStudentIndex = 0; // Unique ID generator

  // Helper to create member objects
  const createMembers = (names: string[], classId: 'A' | 'B'): Student[] => {
    return names.map((name, i) => ({
      id: `s-${globalStudentIndex++}`,
      name: name,
      role: ROLES[i % ROLES.length],
      avatarUrl: `https://api.dicebear.com/7.x/avataaars/svg?seed=${name.replace(' ', '')}`,
      individualScore: 80,
      cvUrl: undefined,
      classId: classId
    }));
  };

  // --- GENERATION CLASSE A (Agences 1 à 6) ---
  let cursorA = 0;
  for (let i = 1; i <= 6; i++) {
    // Logic: First 3 teams get 4 members, Last 3 teams get 3 members = 21 total
    const membersCount = i <= 3 ? 4 : 3;
    const teamNames = CLASS_A_NAMES.slice(cursorA, cursorA + membersCount);
    cursorA += membersCount;

    const members = createMembers(teamNames, 'A');

    agencies.push({
      id: `a${i}`,
      name: `Équipe ${i}`,
      tagline: "En attente de définition...",
      ve_current: 50,
      status: 'stable',
      classId: 'A',
      budget_real: 5000,
      budget_valued: 0,
      eventLog: [
         { id: `e${i}-1`, date: "2024-02-01", type: "VE_DELTA", label: "Création Agence", deltaVE: 50, description: "Capital de départ" }
      ],
      members: members,
      peerReviews: [],
      currentCycle: CycleType.MARQUE_BRIEF,
      projectDef: {
        problem: "",
        target: "",
        location: "",
        gesture: "",
        isLocked: false
      },
      mercatoRequests: [],
      constraints: { space: "", style: "", client: "" },
      progress: JSON.parse(JSON.stringify(INITIAL_WEEKS))
    });
  }

  // --- GENERATION CLASSE B (Agences 7 à 12) ---
  let cursorB = 0;
  for (let i = 7; i <= 12; i++) {
    // Logic: First 3 teams (7,8,9) get 4 members, Last 3 teams (10,11,12) get 3 members = 21 total
    const relativeIndex = i - 6;
    const membersCount = relativeIndex <= 3 ? 4 : 3;
    const teamNames = CLASS_B_NAMES.slice(cursorB, cursorB + membersCount);
    cursorB += membersCount;

    const members = createMembers(teamNames, 'B');

    agencies.push({
      id: `a${i}`,
      name: `Équipe ${i}`,
      tagline: "En attente de définition...",
      ve_current: 50,
      status: 'stable',
      classId: 'B',
      budget_real: 5000,
      budget_valued: 0,
      eventLog: [
         { id: `e${i}-1`, date: "2024-02-01", type: "VE_DELTA", label: "Création Agence", deltaVE: 50, description: "Capital de départ" }
      ],
      members: members,
      peerReviews: [],
      currentCycle: CycleType.MARQUE_BRIEF,
      projectDef: {
        problem: "",
        target: "",
        location: "",
        gesture: "",
        isLocked: false
      },
      mercatoRequests: [],
      constraints: { space: "", style: "", client: "" },
      progress: JSON.parse(JSON.stringify(INITIAL_WEEKS))
    });
  }

  // Add the "Unassigned" Agency (Chômage Pool)
  agencies.push({
      id: 'unassigned',
      name: "Vivier / Chômage",
      tagline: "En recherche d'opportunité",
      ve_current: 0,
      status: 'critique',
      classId: 'ALL', // Holds students from both A and B
      budget_real: 0,
      budget_valued: 0,
      eventLog: [],
      members: [], // Starts empty, will be filled by firing
      peerReviews: [],
      currentCycle: CycleType.MARQUE_BRIEF,
      projectDef: { problem: "", target: "", location: "", gesture: "", isLocked: true },
      mercatoRequests: [],
      constraints: { space: "", style: "", client: "" },
      progress: {}
  });

  return agencies;
};

